import React from "react";
import "../CSS/Footer.css";
const Footer = () => {
  return (
    <div className="FooterWrapper">
      <div className="Head-Wrapper">
        <div className="Headear">
          <div className="Logo">
            <h2>BlogWiki</h2>
            <p>Inspired by Information</p>
          </div>
          <div className="line"></div>
        </div>
        <div>
          <input type="search" />
        </div>
      </div>
    </div>
  );
};
export default Footer;
